static void presend_modify_checksum(T_Package *p)
{
	if(p->function_id == FUNCTION_ZSC_VERIFY)
	{
		T_Slice *sheader = (T_Slice *)(p+sizeof(T_Package));
		printf("origin checksum is 0x%02x\n", sheader->checksum);
		sheader->checksum += 1;
		printf("modify checksum to 0x%02x\n", sheader->checksum);
	}
}

