static int bench_burn_test(int count)
{
	char *b = get_burn();
	int blen = strlen(b)/2;
	int ok = 0, failed = 0;
	uint8_t *data = (uint8_t*)malloc(blen);
	hextobin(b, data, blen);
	PROFILE_START();
	for(int j = 0; j < count; j++)
	{
		BoeErr *ret = doTSU_ZSCVerify(data, blen);
		if(ret != BOE_OK)
		{
			failed += 1;
		} 
		else
		{
			ok += 1;
		}
	}
	PROFILE_END("bench test");
	printf("total %d, failed %d, ok %d\n", count, failed, ok);
	return 0;
}


