static int merge_burn_and_burn()
{
	char *b1 = get_burn();
	int blen_b1 = strlen(b1)/2;
	uint8_t *data_1 = (uint8_t*)malloc(blen_b1);
	hextobin(b1, data_1, blen_b1);

	char *b2 = get_burn();
	int blen_b2 = strlen(b2)/2;
	uint8_t *data_2 = (uint8_t*)malloc(blen_b2);
	hextobin(b2, data_2, blen_b2);

	BoeErr *result_b1, *result_b2;

	doTSU_ZSCVerify_Merge(data_1,blen_b1,&result_b1, data_2,blen_b2, &result_b2);
	if(!(result_b1 == &e_hw_verify_failed && result_b2 == &e_ok))
	{
		printf("failed: burn_1 should failed and burn_2 should be ok.\n");
		return 1;
	}
	return 0;
}

static int merge_burn_and_transfer()
{
	char *b1 = get_burn();
	int blen_b1 = strlen(b1)/2;
	uint8_t *data_1 = (uint8_t*)malloc(blen_b1);
	hextobin(b1, data_1, blen_b1);

	char *b2 = get_transfer();
	int blen_b2 = strlen(b2)/2;
	uint8_t *data_2 = (uint8_t*)malloc(blen_b2);
	hextobin(b2, data_2, blen_b2);

	BoeErr *result_b1, *result_b2;

	doTSU_ZSCVerify_Merge(data_1,blen_b1,&result_b1, data_2,blen_b2, &result_b2);
	if( result_b1 != &e_hw_verify_failed && result_b2 != &e_ok)
	{
		printf("failed: burn should failed and transfer should be ok.\n");
		return 1;
	}
	return 0;
}

static int multipacket_test(void)
{
	unsigned char *data = (unsigned char *)malloc(1000*5);
	int i = 0, j = 0, idx = 0;
	for (i = 0; i < 5; i++)
	{
		for (j = 0; j < 1000; j++)
		{
			idx = 1000*i + j;
			data[idx] = i+1;
		}
	}

	BoeErr *ret = doTSU_ZSCVerify(data, 1000*5);
	if(ret != BOE_OK)
	{
		printf("zscverify failed.\n");
		return 1;
	}
	return 0;
}

